                    <div className={style.textoCGContainer}>
                        <div className={style.divTextoCG}>
                            <h1 className={style.nombreDevo}>¿Realmente hay poder en la oración?</h1>
                            <p className={style.textoCG}>
                                La primera práctica de un cristiano global es ORAR, ya que la oración es el recurso más poderoso para la misión de Dios. Jesús nos enseña en Mateo 9:37-38 a pedir por obreros para la cosecha, recordándonos que la oración moviliza personas, recursos y herramientas, y que todo depende de Dios. Como dice Santiago 5:16, "la oración del justo es poderosa y eficaz".
                                Soy desafiado a: dedicar hoy un espacio en tu tiempo de oración para interceder por los misioneros y las etnias que aún no conocen de Dios.
                            </p>
                        </div>
                    </div>
