                        <div className={style.divTextoExpe}>

                            <h1 className={style.tituloExp}>¿Sabías que el CIMA no termina el 25 de Enero?</h1>
                            <h1 className={style.subtituloExp}>¡Vamos a Experimenta!</h1>
                            <p className={style.textoExpe}>
                                Experimenta es mucho más que un viaje: es tu oportunidad de vivir prácticas misioneras de corto plazo desde 5 días a 6 semanas, desafiar tu carácter y profundizar tu relación con Cristo mientras impactas vidas por medio del amor, la palabra y el servicio.

                                Este año tienes más de 50 destinos en 4 continentes diferentes, América, África, Asia y Europa te esperan con oportunidades únicas para llevar el mensaje de esperanza, desde el centro de grandes ciudades hasta rincones remotos del mundo.

                                Una experiencia intercultural, colaborando con diferentes países, aprendiendo a trabajar en la unidad por medio de Cristo. Sé parte de esta experiencia que te acercará al corazón de Dios por las naciones.

                                ¡Hay una práctica para ti! Visítanos en la feria cimática, allí podrás inscribirte, descubrir todos los destinos disponibles y conversar con nuestro equipo para resolver tus dudas.
                                También puedes realizar tu inscripción por medio de la web www.cimaregional2025.com
                            </p>
                        </div>

